import './App.css';


function App() {

  const handleSubmit = (e) => {
    e.preventDefault();
  }

  var divisores = (numero) => {
    var divisores = [];
    for (var i = 1; i <= numero; i++) {
      if (numero % i === 0) {
        divisores.push(i);
      }
    }
    return divisores;
  }


  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        <input type="number" id="numero" />
        <button type="submit" onClick={divisores}>Calcular</button>
      </form>
      <h1>{divisores}</h1>
    </div>
  );
}

export default App;
